import React, { useState } from "react";
import styled from "../styled";
import NPSFeedback from "./feedback";
const NPSContainer = styled("div")({
    width: "50%",
    margin: "auto",
    borderRadius: "8px",
}, props => ({
    background: props.$submit ? "unset" : "#F9F9FE",
}));
const NPSWizard = () => {
    const [hasSubmit, setSubmit] = useState(false);
    return (React.createElement(NPSContainer, { "$submit": hasSubmit, "data-testid": "nps-wizard" },
        React.createElement(NPSFeedback, { origin: "WIZARD", onSubmit: setSubmit })));
};
export default NPSWizard;
